def generateParenthesis(n: int) -> List[str]:
    def generate(p, left, right, parens=[]):
        if right >= left >= 0:
            if not right: parens += p,
            generate(p + '(', left - 1, right)
            generate(p + ')', left, right - 1)
        return parens
    return generate('', n, n)
